create database GOT;

use GOT;

CREATE TABLE Personagem 
(
    Characterr	VARCHAR(512),
    Actor_ess	VARCHAR(512),
    Episodes_appeared	INT,
    First_appearance	INT,
    Last_appearance	INT
);




CREATE TABLE Episodios 
(
    Season	INT,
    Episode	INT,
    Title	VARCHAR(512),
    Release_date	VARCHAR(512),
    Rating	DOUBLE,
    Votes	INT,
    Summary	VARCHAR(512),
    Writer_1	VARCHAR(512),
    Writer_2	VARCHAR(512),
    Star_1	VARCHAR(512),
    Star_2	VARCHAR(512),
    Star_3	VARCHAR(512),
    Users_reviews	INT,
    Critics_reviews	INT,
    US_Viewers	DOUBLE,
    Duration	INT,
    Director	VARCHAR(512),
    Budget_estimate	VARCHAR(512)
);



CREATE TABLE Casas 
(
    House_name	VARCHAR(512),
    Region	VARCHAR(512)
);

